import React, { Component } from 'react';
import axios from 'axios';
import Button from '@material-ui/core/Button';

/**createPayload = async () => {
  let res = await api.post('/', {
    queueName: 'user',
    payload: 'Sent from react',
  });
  console.log(res);
};**/

const api = axios.create({
  baseURL: `http://localhost:8000/post/msg`,
});

export default class createContent extends Component {
  createPayload = async () => {
    let res = await axios({
      api,
      method: 'POST',
      data: { queueName: 'user', payload: 'Sent from react' },
      raxConfig: {
        retry: 3,
        retryDelay: 4000,
      },
    });
  };
  render() {
    return (
      <div>
        <Button
          variant="contained"
          color="secondary"
          onClick={this.createPayload}
        >
          Order Me
        </Button>
      </div>
    );
  }
}
